class Node {
  constructor(val) {
    this.val = val;
    this.right = null;
    this.left = null;
  }

  isPresent(val, root) {
    let currentNode = root,
      match = true;

    while (currentNode && match) {
      if (val < currentNode.val) {
        currentNode = currentNode.left;
      } else if (val > currentNode.val) {
        currentNode = currentNode.right;
      } else match = false;
    }

    if (match) return 1;
    return 0;
  }
}

